import logo from './logo.svg';
import './App.css';
import LogInPage from './components/LogInPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<LogInPage/>}/>
      </Routes>
    </Router>
  );
}

export default App;
